import Flicking from "@egjs/react-flicking";
import "@egjs/react-flicking/dist/flicking.css";
import { FrameGrid} from "@egjs/grid";
import { Box } from "@mui/material";

const Slider = () => {
    return (
        <Box>
            <Flicking>
                <img src={`${process.env.PUBLIC_URL}/img/toppings/almendra.jpg`} alt="Almendra"/>
                <img src={`${process.env.PUBLIC_URL}/img/toppings/amaranto.jpg`} alt="Almendra"/>
                <img src={`${process.env.PUBLIC_URL}/img/toppings/cajeta.jpg`} alt="Almendra"/>
                <img src={`${process.env.PUBLIC_URL}/img/toppings/blueberries.jpg`} alt="Almendra"/>
            </Flicking>
        </Box>

    )
}

export default Slider;
